(814, 99, 145, 1, '奔跑舞曲', '', '2006-05-26 00:00:00', 0000, 0, 1, 7, '', '在莫名 反覆的音樂之中跳吧\n開不開心 都無所謂\n提著 剩餘 的偏執 與放浪\n在朦朧中 想著一切\n忘情 的天堂 卻只想 逃跑\n清晰 的心跳 就要 瘋掉\n\n在雨滴 忙亂 堆積的丘眺望\n看不看見 也無所謂\n沒空閒 整理一些空曠\n都化成雪 一片一片\n擁擠 的天堂 卻只想 逃跑\n寧靜 的夕陽 映著 微笑\n\n在無聲 無息的 追逐遊戲跳吧\n醒著或醉 不是絕對\n忘掉所有 的堅持與方向\n還有明天 能夠實現\n忘情 的天堂 卻只想 逃跑\n清晰 的心跳 就要 瘋掉', 271, '', '', '', '', '', '', 1, 1, 0, '2008-03-11 19:26:00', '2015-03-12 13:30:31', '0000-00-00 00:00:00'),
(815, 99, 145, 2, 'And Go', '', '2006-05-26 00:00:00', 0000, 0, 1, 7, '', 'So let it go let it be\nIsn''t it an easier way to me?\nSo let it go, so let it be\nIsn''t it an easier way? Hey~\nSo let it go let it be\nIsn''t easier to me?\nSo let it go, so let it be\n\n背離了我 分歧 的路\n模糊了我 與明亮 的缺口\n在黑暗之中 揮 不去的\n催促著我 將 一切經過\n而未完 成的 故事 總唯美的令人遺憾\n但最盛開的季 節 枯萎 這不是我的答案\n轉 變一段輕狂的絢爛\nSo let it go let it be\nIsn''t it an easier way to me?\nSo let it go, so let it be\nIsn''t it an easier way? Hey~\nSo let it go let it be\nIsn''t easier to me?\nSo let it go, so let it be\n\n異樣的我 流離失所\n成長的理由 吹撫 著牽 累\n在黑暗之中 揮 不去的\n困擾著我 讓 一切奔走\n而未完 成的 故事 總唯美的令人遺憾\n但最盛開的季 節 枯萎 這不是我的答案\n轉 變一段輕狂的絢爛\nSo let it go let it be\nIsn''t it an easier way to me?\nSo let it go, so let it be\nIsn''t it an easier way? Hey~\nSo let it go let it be\nIsn''t easier to me?\nSo let it go, so let it be', 319, '', '', '', '', '', '', 1, 1, 0, '2008-03-12 02:21:29', '2015-03-12 13:30:31', '0000-00-00 00:00:00'),
(816, 99, 145, 3, 'Rainbow 4 AM', '', '2006-05-26 00:00:00', 0000, 0, 1, 7, '', '有經過 了多 久~\n看到一個曲線 劃 過一個視 線 在雨後的天空裡面 它才會出 現\n我停留 了多 久~\n又站在自己裡面 等 待什麼出 現 在越過了某種界線 才能夠看 見\n愛 想 太 多 ~\n我想要解釋這世界 卻還不能理解一切\n愛 想 太 多 ~\n你不想理會這世界 卻還不能釋懷一切\n\n有經過 了多 久~\n看到一個曲線 劃 過一個視 線 在雨後的天空裡面 又再度出 現\n我停留 了多 久~\n又站在自己裡面 等 待什麼出 現 在越過了某種界線 才能夠看 見\n幻 想 太 多\n請不要這樣說出來 想留住那一片藍\n幻 想 太 多\nI Just Wana Be All Right Say Tomorrow Will Be Fine\n\n一個兩個顏色 多一些 三四五六七個 看不見 好像一種追尋 許久 的感覺\n我想這樣留住 這時間 不要這樣美好 就幻滅 請多陪我一些 在天亮 之 前', 201, '', '', '', '', '', '', 1, 1, 0, '2008-03-12 02:58:08', '2015-03-12 13:30:31', '0000-00-00 00:00:00'),
(817, 99, 145, 4, 'Silvery', '', '2006-05-26 00:00:00', 0000, 0, 1, 7, '', 'Silvery\n\n作詞：克拉克\n作曲：克拉克\n\n\n你披著冷漠的外表 聆聽著音樂正在圍繞\n以為能隔離一些 無聊的喧鬧 不睡 著\n在心裡堆滿的問號 延伸著數不盡的疲勞\n就這樣繼續你那 自溺的思考 很驕 傲\n\nSilvery 用你的靈魂去 累積\nOh~多麼 炫 麗 你抹著銀色的 眼睛\n但這裡不能 再夢想\n掩埋 在 地下 退 化\n\n這世界更加的靠近 卻不能理解你的生命\n努力去擺脫約束現實的邏輯 扭曲 你\n你得到更多的勇氣 來反抗不完美的過去\n呼吸著懸浮某種 微粒的空氣 很清 醒\n\nSilvery 擁有著奇異的旋律 進行\n不能再 夢想 不代表就 要 這樣 蒸 發\n你願意交換所有願望 來抵擋一切不認同的回答\n用你那不對 稱 的翅膀 卻更要奮力 的飛 翔\n\n\nSilvery 用你的靈魂去 累積\nOh~多麼 炫 麗 你抹著銀色的 眼睛\n但這裡不能 再夢想\n不能擁有非分的 美麗偽裝\n\n\nSilvery 這一種過度的華麗\nOh~ 看 著你 這是否正是你自己\nSilvery 這一種過度的華麗\nOh~ 看 著你 這是否正是你自己\n\nSilvery 這一種過度的華麗\nOh~ 看 著你 這是否正是你自己\nSilvery 這一種過度的華麗\nOh~ 看 著你 請這樣認識你自己', 370, '', '', '', '', '', '', 1, 1, 0, '2008-03-12 03:11:11', '2015-03-12 13:30:31', '0000-00-00 00:00:00'),
