(829, 33, 0, 1, 'If I See the Devil (demo)', '', '2007-11-01 00:00:00', 0000, 0, 1, 7, 'If I see the devil 怎能停止被剝奪\r\nIf I see the devil 你在夜裡受折磨\r\n                                                                                \r\n為了你純潔完美無瑕 我承受一切沙漠的風暴\r\n就這麼吹蝕風化殆盡 卻無法再為你繼續承擔遮蔽\r\n                                                                                \r\nAnd I dream the nightmare 我瘋狂用力追逐著\r\nAnd I dream the nightmare 你沒命痛苦哀嚎著\r\n                                                                                \r\n我一轉身回頭就被   紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n                                                                                \r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛   \r\n                                                                                \r\nIf I see the dark night 睜開眼以為醒來\r\nIf I see the dark night 原來噩夢離不開\r\n                                                                                \r\n我一轉身回頭就被   紅色的傷心平原所淹沒\r\n在那裡吶喊狂叫無助 無聲尖叫撕裂希望\r\n                                                                                \r\n別再奪走我一切 讓我體無完膚還不夠\r\n不要踐踏我的心 我的尊嚴我的真愛  \r\n\r\n 拖著千瘡百孔的身體\r\n我殘廢了  但前進著\r\n(我前進著  前進著)\r\n                                                                                \r\n在他眼中沒有憐憫 在我面前只剩空氣\r\n最初的你要去哪裡 你我倆相依為命\r\n', '', 271, '', 'twice a week', 'twice a week', '', '', '', 1, 1, 0, '2008-03-17 00:18:40', '2015-03-12 13:30:31', '0000-00-00 00:00:00'),
